  "info": {
    "title": "Natural Language Understanding",
    "version": "1.0",
    "description": "Analyze various features of text content at scale. Provide text, raw HTML, or a public URL and IBM Watson Natural Language Understanding will give you results for the features you request. The service cleans HTML content before analysis by default, so the results can ignore most advertisements and other unwanted content.\n\nYou can create [custom models](https://cloud.ibm.com/docs/natural-language-understanding?topic=natural-language-understanding-customizing) with Watson Knowledge Studio to detect custom entities and relations in Natural Language Understanding.",
    "x-vcap-service-name": "natural-language-understanding",
    "x-version-date": "2021-08-01",
    "x-sdk-supported-languages": [
      "java",
      "node",
