                    "type": "code",
                    "source": [
                      "curl -u \"apikey:{apikey}\" \\\n",
                      "  \"{url}/v1/analyze}?version=2021-08-01&url=www.ibm.com&features=keywords,entities&entities.emotion=true&entities.sentiment=true&keywords.emotion=true&keywords.sentiment=true\""
