      "post": {
        "operationId": "analyze",
        "tags": [
          "Analyze"
        ],
        "summary": "Analyze text",
        "description": "Analyzes text, HTML, or a public webpage for the following features:\n- Categories\n- Classifications\n- Concepts\n- Emotion\n- Entities\n- Keywords\n- Metadata\n- Relations\n- Semantic roles\n- Sentiment\n- Syntax\n- Summarization (Experimental)\n\nIf a language for the input text is not specified with the `language` parameter, the service [automatically detects the language](https://cloud.ibm.com/docs/natural-language-understanding?topic=natural-language-understanding-detectable-languages).",
        "requestBody": {
          "content": {
            "application/json": {
              "schema": {
                "$ref": "#/components/schemas/Parameters"
              }
            }
          },
          "description": "An object containing request parameters. The `features` object and one of the `text`, `html`, or `url` attributes are required.",
          "required": true
        },
        "x-codegen-request-body-name": "parameters",
        "responses": {
          "200": {
            "$ref": "#/components/responses/AnalyzeResponse"
          },
          "400": {
            "description": "Invalid request",
            "content": {
              "application/json": {
                "schema": {
                  "$ref": "#/components/schemas/ErrorResponse"
                }
              }
            }
          }
        },
        "x-sdk-operations": {
          "request-examples": {
            "curl": [
              {
                "name": "Example request",
                "example": [
                  {
                    "type": "code",
                    "source": [
                      "curl -X POST -u \"apikey:{apikey}\" -H \"Content-Type: application/json\" -d @parameters.json \"{url}/v1/analyze?version=2021-08-01\""
                    ]
                  }
                ]
              },
              {
                "name": "Example parameters",
                "example": [
                  {
                    "type": "code",
                    "source": [
                      "{\n",
                      "  \"text\": \"IBM is an American multinational technology company headquartered in Armonk, New York, United States, with operations in over 170 countries.\",\n",
                      "  \"features\": {\n",
                      "    \"entities\": {\n",
                      "      \"emotion\": true,\n",
                      "      \"sentiment\": true,\n",
                      "      \"limit\": 2\n",
                      "    },\n",
                      "    \"keywords\": {\n",
                      "      \"emotion\": true,\n",
                      "      \"sentiment\": true,\n",
                      "      \"limit\": 2\n",
                      "    }\n",
                      "  }\n",
                      "}"
                    ]
                  }
                ]
              }
            ],
            "dotnet-standard": [
              {
                "name": "Example request",
                "example": [
                  {
                    "type": "code",
                    "source": [
                      "IamAuthenticator authenticator = new IamAuthenticator(\n",
                      "    apikey: \"{apikey}\"\n",
                      "    );\n",
                      "\n",
                      "NaturalLanguageUnderstandingService naturalLanguageUnderstanding = new NaturalLanguageUnderstandingService(\"2020-08-01\", authenticator);\n",
                      "naturalLanguageUnderstanding.SetServiceUrl(\"{url}\");\n",
                      "\n",
                      "var features = new Features()\n",
                      "{\n",
                      "    Keywords = new KeywordsOptions()\n",
                      "    {\n",
                      "        Limit = 2,\n",
                      "        Sentiment = true,\n",
                      "        Emotion = true\n",
                      "    },\n",
                      "    Entities = new EntitiesOptions()\n",
                      "    {\n",
                      "        Sentiment = true,\n",
                      "        Limit = 2\n",
                      "    }\n",
                      "};\n",
                      "\n",
                      "var result = naturalLanguageUnderstanding.Analyze(\n",
                      "    features: features,\n",
                      "    text: \"IBM is an American multinational technology company headquartered in Armonk, New York, United States, with operations in over 170 countries.\"\n",
                      "    );\n",
                      "\n",
                      "Console.WriteLine(result.Response);"
                    ]
                  }
                ]
              }
            ],
            "go": [
              {
                "name": "Example request",
                "example": [
                  {
                    "type": "code",
                    "source": [
                      "package main\n",
                      "\n",
                      "import (\n",
                      "  \"encoding/json\"\n",
                      "  \"fmt\"\n",
                      "  \"github.com/IBM/go-sdk-core/core\"\n",
                      "  \"github.com/watson-developer-cloud/go-sdk/v2/naturallanguageunderstandingv1\"\n",
                      ")\n",
                      "\n",
                      "func main() {\n",
                      "  authenticator := &core.IamAuthenticator{\n",
                      "    ApiKey:     \"{apikey}\",\n",
                      "  }\n",
                      "\n",
                      "  options := &naturallanguageunderstandingv1.NaturalLanguageUnderstandingV1Options{\n",
                      "    Version: \"2020-08-01\",\n",
                      "    Authenticator: authenticator,\n",
                      "  }\n",
                      "\n",
                      "  naturalLanguageUnderstanding, naturalLanguageUnderstandingErr := naturallanguageunderstandingv1.\n",
                      "    NewNaturalLanguageUnderstandingV1(options)\n",
                      "\n",
                      "  if naturalLanguageUnderstandingErr != nil {\n",
                      "   panic(naturalLanguageUnderstandingErr)\n",
                      "  }\n",
                      "\n",
                      "  naturalLanguageUnderstanding.SetServiceURL(\"{url}\")\n",
                      "\n",
                      "  text := `IBM is an American multinational technology company\n",
                      "           headquartered in Armonk, New York, United States\n",
                      "           with operations in over 170 countries.`\n",
                      "  result, _, responseErr := naturalLanguageUnderstanding.Analyze(\n",
                      "    &naturallanguageunderstandingv1.AnalyzeOptions{\n",
                      "      Text: &text,\n",
                      "      Features: &naturallanguageunderstandingv1.Features{\n",
                      "        Emotion: &naturallanguageunderstandingv1.EmotionOptions{\n",
                      "          Document: core.BoolPtr(true),\n",
                      "        },\n",
                      "        Sentiment: &naturallanguageunderstandingv1.SentimentOptions{\n",
                      "          Document: core.BoolPtr(true),\n",
                      "        },\n",
                      "      },\n",
                      "    },\n",
                      "  )\n",
                      "  if responseErr != nil {\n",
                      "    panic(responseErr)\n",
                      "  }\n",
                      "  b, _ := json.MarshalIndent(result, \"\", \"  \")\n",
                      "  fmt.Println(string(b))\n",
                      "}"
                    ]
                  }
                ]
              }
            ],
            "java": [
              {
                "name": "Example request",
                "example": [
                  {
                    "type": "code",
                    "source": [
                      "IamAuthenticator authenticator = new IamAuthenticator(\"{apikey}\");\n",
                      "NaturalLanguageUnderstanding naturalLanguageUnderstanding = new NaturalLanguageUnderstanding(\n",
                      "  \"2020-08-01\", authenticator);\n",
                      "naturalLanguageUnderstanding.setServiceUrl(\"{url}\");\n",
                      "\n",
                      "String text = \"IBM is an American multinational technology \" +\n",
                      "  \"company headquartered in Armonk, New York, \" +\n",
                      "  \"United States, with operations in over 170 countries.\";\n",
                      "\n",
                      "EntitiesOptions entitiesOptions = new EntitiesOptions.Builder()\n",
                      "  .emotion(true)\n",
                      "  .sentiment(true)\n",
                      "  .limit(2)\n",
                      "  .build();\n",
                      "\n",
                      "KeywordsOptions keywordsOptions = new KeywordsOptions.Builder()\n",
                      "  .emotion(true)\n",
                      "  .sentiment(true)\n",
                      "  .limit(2)\n",
                      "  .build();\n",
                      "\n",
                      "Features features = new Features.Builder()\n",
                      "  .entities(entitiesOptions)\n",
                      "  .keywords(keywordsOptions)\n",
                      "  .build();\n",
                      "\n",
                      "AnalyzeOptions parameters = new AnalyzeOptions.Builder()\n",
                      "  .text(text)\n",
                      "  .features(features)\n",
                      "  .build();\n",
                      "\n",
                      "AnalysisResults response = naturalLanguageUnderstanding\n",
                      "  .analyze(parameters)\n",
                      "  .execute()\n",
                      "  .getResult();\n",
                      "System.out.println(response);"
                    ]
                  }
                ]
              }
            ],
            "node": [
              {
                "name": "Example request",
                "example": [
                  {
                    "type": "code",
                    "source": [
                      "const NaturalLanguageUnderstandingV1 = require('ibm-watson/natural-language-understanding/v1');\n",
                      "const { IamAuthenticator } = require('ibm-watson/auth');\n",
                      "\n",
                      "const naturalLanguageUnderstanding = new NaturalLanguageUnderstandingV1({\n",
                      "  version: '2021-03-25',\n",
                      "  authenticator: new IamAuthenticator({\n",
                      "    apikey: '{apikey}',\n",
                      "  }),\n",
                      "  serviceUrl: '{url}',\n",
                      "});\n",
                      "\n",
                      "const analyzeParams = {\n",
                      "  'url': 'www.ibm.com',\n",
                      "  'features': {\n",
                      "    'entities': {\n",
                      "      'emotion': true,\n",
                      "      'sentiment': true,\n",
                      "      'limit': 2,\n",
                      "    },\n",
                      "    'keywords': {\n",
                      "      'emotion': true,\n",
                      "      'sentiment': true,\n",
                      "      'limit': 2,\n",
                      "    },\n",
                      "  },\n",
                      "};\n",
                      "\n",
                      "naturalLanguageUnderstanding.analyze(analyzeParams)\n",
                      "  .then(analysisResults => {\n",
                      "    console.log(JSON.stringify(analysisResults, null, 2));\n",
                      "  })\n",
                      "  .catch(err => {\n",
                      "    console.log('error:', err);\n",
                      "  });"
                    ]
                  }
                ]
              }
            ],
            "python": [
              {
                "name": "Example request",
                "example": [
                  {
                    "type": "code",
                    "source": [
                      "import json\n",
                      "from ibm_watson import NaturalLanguageUnderstandingV1\n",
                      "from ibm_cloud_sdk_core.authenticators import IAMAuthenticator\n",
                      "from ibm_watson.natural_language_understanding_v1 \n",
                      "    import Features, EntitiesOptions, KeywordsOptions\n",
                      "\n",
                      "authenticator = IAMAuthenticator('{apikey}')\n",
                      "natural_language_understanding = NaturalLanguageUnderstandingV1(\n",
                      "    version='2021-03-25',\n",
                      "    authenticator=authenticator)\n",
                      "\n",
                      "natural_language_understanding.set_service_url('{url}')\n",
                      "\n",
                      "response = natural_language_understanding.analyze(\n",
                      "    text='IBM is an American multinational technology company '\n",
                      "    'headquartered in Armonk, New York, United States, '\n",
                      "    'with operations in over 170 countries.',\n",
                      "    features=Features(\n",
                      "        entities=EntitiesOptions(emotion=True, sentiment=True, limit=2),\n",
                      "        keywords=KeywordsOptions(emotion=True, sentiment=True,\n",
                      "                                 limit=2))).get_result()\n",
                      "\n",
                      "print(json.dumps(response, indent=2))"
                    ]
                  }
                ]
              }
            ],
            "ruby": [
              {
                "name": "Example request",
                "example": [
                  {
                    "type": "code",
                    "source": [
                      "require \"json\"\n",
                      "require \"ibm_watson/authenticators\"\n",
                      "require \"ibm_watson/natural_language_understanding_v1\"\n",
                      "include IBMWatson\n",
                      "\n",
                      "natural_language_understanding = NaturalLanguageUnderstandingV1.new(\n",
                      "  version: \"2021-03-25\",\n",
                      "  authenticator: authenticator\n",
                      ")\n",
                      "\n",
                      "natural_language_understanding.service_url = \"{url}\"\n",
                      "\n",
                      "response = natural_language_understanding.analyze(\n",
                      "  text: \"IBM is an American multinational technology company \"\n",
                      "       \"headquartered in Armonk, New York, United States, \"\n",
                      "       \"with operations in over 170 countries.\",\n",
                      "  features: {\n",
                      "    entities: {\n",
                      "      emotion: true,\n",
                      "      sentiment: true,\n",
                      "      limit: 2\n",
                      "    },\n",
                      "    keywords: {\n",
                      "      emotion: true,\n",
                      "      sentiment: true,\n",
                      "      limit: 2\n",
                      "    }\n",
                      "  }\n",
                      ")\n",
                      "\n",
                      "puts JSON.pretty_generate(response.result)"
                    ]
                  }
                ]
              }
            ],
            "swift": [
              {
                "name": "Example request",
                "example": [
                  {
                    "type": "code",
                    "source": [
                      "let authenticator = WatsonIAMAuthenticator(apiKey: \"{apikey}\")\n",
                      "let naturalLanguageUnderstanding = NaturalLanguageUnderstanding(version: \"2021-03-25\", authenticator: authenticator)\n",
                      "naturalLanguageUnderstanding.serviceURL = \"{url}\"\n",
                      "\n",
                      "let text = \"IBM is an American multinational technology \" +\n",
                      "  \"company headquartered in Armonk, New York, \" +\n",
                      "  \"United States, with operations in over 170 countries.\"\n",
                      "\n",
                      "let features = Features(\n",
                      "  entities: EntitiesOptions(limit: 2, sentiment: true, emotion: true),\n",
                      "  keywords: KeywordsOptions(limit: 2, sentiment: true, emotion: true)\n",
                      ")\n",
                      "naturalLanguageUnderstanding.analyze(features: features, text: text) {\n",
                      "  response, error in\n",
                      "\n",
                      "  guard let analysis = response?.result else {\n",
                      "    print(error?.localizedDescription ?? \"unknown error\")\n",
                      "    return\n",
                      "  }\n",
                      "\n",
                      "  print(analysis)\n",
                      "}"
                    ]
                  }
                ]
              }
            ],
            "unity": [
              {
                "name": "Example request",
                "example": [
                  {
                    "type": "code",
                    "source": [
                      "var authenticator = new IamAuthenticator(\n",
                      "    apikey: \"{apikey}\"\n",
                      ");\n",
                      "\n",
                      "while (!authenticator.CanAuthenticate())\n",
                      "    yield return null;\n",
                      "\n",
                      "var naturalLanguageUnderstanding = new NaturalLanguageUnderstandingService(\"2020-08-01\", authenticator);\n",
                      "naturalLanguageUnderstanding.SetServiceUrl(\"{url}\");\n",
                      "\n",
                      "Features features = new Features()\n",
                      "{\n",
                      "    Keywords = new KeywordsOptions()\n",
                      "    {\n",
                      "        Limit = 2,\n",
                      "        Sentiment = true\n",
                      "    },\n",
                      "    Entities = new EntitiesOptions()\n",
                      "    {\n",
                      "        Sentiment = true,\n",
                      "        Model = \"{custom_model_id}\",\n",
                      "        Limit = 2\n",
                      "    },\n",
                      "};\n",
                      "AnalysisResults analyzeResponse = null;\n",
                      "\n",
                      "naturalLanguageUnderstanding.Analyze(\n",
                      "    callback: (DetailedResponse<AnalysisResults> response, IBMError error) =>\n",
                      "    {\n",
                      "        Log.Debug(\"NaturalLanguageUnderstandingServiceV1\", \"Analyze result: {0}\", response.Response);\n",
                      "        analyzeResponse = response.Result;\n",
                      "    },\n",
                      "    features: features,\n",
                      "    text: \"IBM is an American multinational technology company headquartered in Armonk, New York, United States with operations in over 170 countries.\"\n",
                      ");\n",
                      "\n",
                      "while (analyzeResponse == null)\n",
                      "    yield return null;"
                    ]
                  }
                ]
              }
            ]
          }
        }
      }
    },
    "/v1/models": {
      "get": {
        "operationId": "listModels",
        "tags": [
          "Manage models"
        ],
        "summary": "List models",
        "description": "Lists Watson Knowledge Studio [custom entities and relations models](https://cloud.ibm.com/docs/natural-language-understanding?topic=natural-language-understanding-customizing) that are deployed to your Natural Language Understanding service.",
        "parameters": [
          {
            "$ref": "#/components/parameters/version"
          }
        ],
        "responses": {
          "200": {
            "$ref": "#/components/responses/ListModelsResponse"
          },
          "400": {
            "description": "Invalid request",
            "content": {
              "application/json": {
                "schema": {
                  "$ref": "#/components/schemas/ErrorResponse"
                }
              }
            }
          }
        },
        "x-sdk-operations": {
          "request-examples": {
            "curl": [
              {
                "name": "Example request",
                "example": [
                  {
                    "type": "code",
                    "source": [
                      "curl -u \"apikey:{apikey}\" \"{url}/v1/models?version=2021-08-01\""
                    ]
                  }
                ]
              }
            ],
            "dotnet-standard": [
              {
                "name": "Example request",
                "example": [
                  {
                    "type": "code",
                    "source": [
                      "IamAuthenticator authenticator = new IamAuthenticator(\n",
                      "    apikey: \"{apikey}\"\n",
                      "    );\n",
                      "\n",
                      "NaturalLanguageUnderstandingService naturalLanguageUnderstanding = new NaturalLanguageUnderstandingService(\"2020-08-01\", authenticator);\n",
                      "naturalLanguageUnderstanding.SetServiceUrl(\"{url}\");\n",
                      "\n",
                      "var result = naturalLanguageUnderstanding.ListModels();\n",
                      "\n",
                      "Console.WriteLine(result.Response);"
                    ]
                  }
                ]
              }
            ],
            "go": [
              {
                "name": "Example request",
                "example": [
                  {
                    "type": "code",
                    "source": [
                      "package main\n",
                      "\n",
                      "import (\n",
                      "  \"encoding/json\"\n",
                      "  \"fmt\"\n",
                      "  \"github.com/IBM/go-sdk-core/core\"\n",
                      "  \"github.com/watson-developer-cloud/go-sdk/v2/naturallanguageunderstandingv1\"\n",
                      ")\n",
